const Style = {
    body : {
        fontFamily: 'sans-serif',
        fontSize: '16px',
        backgroundImage: "url(../images/micheile-henderson-ZVprbBmT8QA-unsplash.jpg)",
        /* your image */
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat'
      },

      header: {
        backgroundColor: 'rgba(0, 0, 0, 0.5)',
        height: '70px',
        paddingTop: '20px',
      }
}

export default Style;
